import React from 'react';
import { BrowserRouter as Router, Route, Switch, useHistory } from 'react-router-dom';
import MyButton from '../components/ExamButton/ExamButton';
import IELTSAcademic from './IELTSAcademic';


const Home = () =>{
    return (
        <Router>
            <Route exact path="/IELTSAcademic"><h1>This is the academic page</h1></Route>
            <Route path="/"><MyButton name="this is button"/></Route>
            
        </Router>
        
    )
}

export default Home;
